import React, { Component } from "react";
import { Navbar } from "react-bootstrap";

import AdminNavbarLinks from "./AdminNavbarLinks.jsx";

class AdminNavbar extends Component {
  render() {
    return (
      <Navbar fluid>
        <Navbar.Header>
        </Navbar.Header>
          <AdminNavbarLinks />
      </Navbar>
    );
  }
}

export default AdminNavbar;
